import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center justify-center p-4">
      <div className="max-w-2xl w-full bg-white p-8 rounded-lg shadow-md text-center">
        <h1 className="text-3xl font-bold text-gray-800 mb-4">Form Builder</h1>
        <p className="text-gray-600 mb-8">
          Create custom forms with different question types including categorize, cloze, and comprehension questions.
        </p>
        <div className="space-y-4">
          <Link
            to="/builder"
            className="inline-block w-full max-w-xs bg-blue-600 hover:bg-blue-700 text-white font-medium py-3 px-6 rounded-lg transition duration-200"
          >
            Create New Form
          </Link>
          <Link
            to="/builder/sample"
            className="inline-block w-full max-w-xs bg-gray-200 hover:bg-gray-300 text-gray-800 font-medium py-3 px-6 rounded-lg transition duration-200"
          >
            Try Sample Form
          </Link>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
